import getApi from './@api/api';
import React from 'react';

class App extends React.Component {
  state={
    photos:[],
    loaded:false,
    labels:[],
    chklist:[],
  };
  async componentDidMount() {
    const photos = await getApi.getPhotoList(1,12,this.state.chklist);
    const labels = await getApi.getLabelList();
    this.setState({photos:photos,labels:labels, loaded:true});
    console.log(this.state.photos[0].id);
  }
  render() {
    if(!this.state.loaded) return <></>;
    else return <div>
      {this.state.labels.map((item)=>(
        <label>{item.title}<input type="checkbox" /></label>
      ))}
    </div>
  }
}


export default App;
